yarnPath: .yarn/releases/yarn-3.3.0.cjs

defaultSemverRangePrefix: ''

packageExtensions:
  '@google-cloud/pubsub@*':
    dependencies:
      '@grpc/grpc-js': '*'
  'firebase-tools@*':
    dependencies:
      'winston-transport': '*'
  'jest-preset-angular@*':
    dependencies:
      'jest-util': '*'
  'nx@*':
    dependencies:
      '@angular-devkit/core': '*'
